import "./App.css";
import Barchart from "./components/Barchart";
import Piechart from "./components/Piechart";
import Metric from "./components/Metric";
import Wordcloud from "./components/Wordcloud";
import logo from "../assets/logo.jpg";

function App() {
  return (
    <div className="page">
      <strong className="title">
        <img src={logo}/>
        Dashboard for Chatbot Performance</strong>
      <div className="container">
        <div className="left">
          <Metric />
        </div>
        <div className="right">
          <Piechart />
        </div>
        <div className="left">
          <Barchart />
        </div>
        <div className="right">
          <Wordcloud />
        </div>
      </div>
    </div>
  );
}

export default App;
